import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Wollu>
      //<WolluViewEffects>
        <MainView/>
        <GetSalaryView/>
        <GetWolluAmountView/>
        <ShowWalluAmountView/>
        <AggroWolluAppView/>
        <DownloadWalluAppView/>
      //</WolluViewEffects>
    </Wollu>
  </React.StrictMode>
);

